import Vue from 'vue';
import Router from 'vue-router';
import SignupForm from '@/components/SignupForm.vue';
import LoginForm from '@/components/LoginForm.vue';

Vue.use(Router);

export default new Router({
  mode: 'history',
  routes: [
    {
      path: '/signup',
      name: 'Signup',
      component: SignupForm
    },
    {
      path: '/login',
      name: 'Login',
      component: LoginForm
    }
  ]
});
